<?php

namespace App\Database\Seeds;

use CodeIgniter\Database\Seeder;
use CodeIgniter\CLI\CLI;

class CategorySeeder extends Seeder
{
    public function run()
    {
        // init the model
        $model = model('CategoryModel');
        
        // init dataset
        $dataset = [
            [
                'name'          => 'PACKAGE',
                'description'   => '<ul><li>Product bundled</li><li>Lower price</li></ul>',
                'image'         => 'PACKAGE-1632235450_f1ae19bb1199651db003.png',
            ],
            [
                'name'          => 'PRINTER',
                'description'   => '<ul><li>Print cashier receipt<br></li></ul>',
                'image'         => 'printer-1632235549_f55d8afab89a254a1161.png',
            ],
            [
                'name'          => 'BARCODE SCANNER',
                'description'   => '<ul><li>Faster sales with scanned item labels<br></li></ul>',
                'image'         => 'Barcode-scanner-1632235662_f0b6cb516d90c7e117b1.png',
            ],
            [
                'name'          => 'STANDEE',
                'description'   => '<ul><li>ergonomic support device<br></li></ul>',
                'image'         => 'Standee-1632235858_f60bdf66e94e82b0029a.png',
            ],
            [
                'name'          => 'CASH DRAWER',
                'description'   => '<ul><li>Cashier drawer for saving money<br></li></ul>',
                'image'         => 'Cash-drawer-1632235973_ddce1558672725699a0c.png',
            ],
            [
                'name'          => 'DEVICE',
                'description'   => '<ul><li>Touchscreen cashier device</li></ul>',
                'image'         => 'device-1632236057_cd282a142dae8c006096.png',
            ],
            [
                'name'          => 'THERMAL PAPER',
                'description'   => '<ul><li>Used in thermal printers</li></ul>',
                'image'         => 'thermal-paper-1632236117_1aea342a08ae09c4bb80.png',
            ],
        ];
        // init image set
        $base64= [
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/png;base64,",
            "data:image/jpeg;base64,"
        ];

        $this->thumbs = \Config\Services::image();
        $_imgFolder = ROOTPATH.'public/uploads/categories/img/';
        $_thumbFolder = ROOTPATH.'public/uploads/categories/thumb/';
        foreach($dataset as $index=>$ds){
            $images = $this->base64_to_image($base64[$index],$_imgFolder,$ds['image']);
            $this->thumbs->withFile($images)->fit(100, 100, 'center')->save($_thumbFolder.$ds['image']);
        }
         // insert model w/ value
        $model->insertBatch($dataset);
    }

    function base64_to_image($base64_string, $location, $image) {
        $img    = explode( ',', $base64_string );
        if(file_put_contents(set_realpath($location).$image,base64_decode($img[1])))
            return $location.$image; 
    }
}
